describe('Display homepage', () => {
  beforeEach(() => {
    cy.intercept('GET','https://developer.nps.gov/api/v1/parks?api_key=KgfnACP2f09gBqEMUsNGRWvjNFxJkQPuXT9kVb0w', {
      statusCode: 200,
      fixture: 'parks'
    }).as('Homepage')
    cy.visit('http://localhost:3000/')
    cy.wait('@Homepage')
  })
  
  it('should display homepage with header logo, header statements, searchbar, and 9 parks on page load', () => {
    cy.get("[data-test='logo']").should('be.visible').get("img[alt='Logo states NatureEscape']").should('have.attr', 'src','data:image/png;base64,')
    cy.get("[data-test='welcome-message']").contains('h2','Embark on your journey of self-discovery')
    cy.get("[data-test='mainpage-scroll-message']").contains('p', 'Scroll down below to click onto your next destination')
    cy.get("[data-test='search-input']").should('have.attr', 'placeholder', 'Enter Destination Name...')
    cy.get("[data-test='search-icon']").should('have.attr','src','data:image/png;base64,')
    cy.visit('http://localhost:3000/')
    cy.get("[data-test='scroll-down']").contains('h2','SCROLL DOWN')
    cy.get("[data-test='scroll-arrow']").should('be.visible')
    cy.get("[data-test='all-parks']").scrollIntoView();
    cy.get("[data-test='parks-container']").children().should('have.length',9)
  })

  it('should be able to display 9 park buttons each with park information', () => {
    cy.get("[data-test='all-parks']").scrollIntoView();
    cy.get("[data-test='parks-container']").children().should('have.length',9)

    cy.get("[data-test='all-parks']").first().contains('h2', 'Abraham Lincoln Birthplace National Historical Park')
    .get("[data-test='all-parks']").first().contains('The Memorial Building with fall colors: Over 200,000 people a year come to walk up the steps of the Memorial Building to visit the site where Abraham Lincoln was born. Address: 2995 Lincoln Farm Road Hodgenville, KY 42748')
    .get("[data-test='mainpage-image']").first().should('have.attr','src','https://www.nps.gov/common/uploads/structured_data/3C861078-1DD8-B71B-0B774A242EF6A706.jpg')
    
    cy.get("[data-test='all-parks']").last().contains('h2', 'Alaska Public Lands')
    .get("[data-test='all-parks']").last().contains('Hikers on Angel Rocks: Hikers on top of Angel Rocks near Fairbanks look out across the landscape of Chena River State Recreation Area. Address: 605 West 4th Avenue Anchorage, AK 99501')
    .get("[data-test='mainpage-image']").last().should('have.attr','src','https://www.nps.gov/common/uploads/structured_data/2595FA12-DF7A-1B6C-55D8F41ABCA2E011.jpg')
  })

  it('should be able to show an error message letting user know to fill out search input if search field is empty preventing user from searching until they fill out the input fields', () => {
    cy.get("[data-test='search-input']").should('have.value', '')
    cy.get("[data-test='search-button']").click()
    cy.get("[data-test='search-error-message' ]").contains('Please fill out search input.')
  })

  it('should be able fill out search input, click search button, and a show filtered park based on a specified search input', () => {
    // cy.get("[data-test='search-input']").should('have.attr', 'placeholder', 'Enter Destination Name...') 
    cy.get("[data-test='search-input']").type('Abraham').should('have.value', 'Abraham')
    cy.get("[data-test='search-button']").click()
    cy.get("[data-test='filterpage-backhome-button']").scrollIntoView();

    cy.get("[data-test='filterpage-backhome-button']").contains('button','Back To Homepage')
    .get("[data-test='filtered-button-parks-container']").contains('h2', 'Abraham Lincoln Birthplace National Historical Park')
    .get("[data-test='filtered-button-parks-container']").contains('The Memorial Building with fall colors: Over 200,000 people a year come to walk up the steps of the Memorial Building to visit the site where Abraham Lincoln was born. Address: 2995 Lincoln Farm Road Hodgenville, KY 42748')
    .get("[data-test='mainpage-image']").should('have.attr','src','https://www.nps.gov/common/uploads/structured_data/3C861078-1DD8-B71B-0B774A242EF6A706.jpg')
  })

  it('should be should also be able to show filtered parks based on a general search input', () => {
    cy.get("[data-test='search-input']").type('Park').should('have.value', 'Park')
    cy.get("[data-test='search-button']").click()
    cy.get("[data-test='filterpage-backhome-button']").scrollIntoView();
    cy.get("[data-test='filterpage-backhome-button']").contains('button','Back To Homepage')

    cy.get("[data-test='filtered-parks-container']").scrollIntoView();
    cy.get("[data-test='filtered-parks-container']").children().should('have.length',3)
    .get("[data-test='filtered-parks-container']").first().contains('h2', 'Abraham Lincoln Birthplace National Historical Park')
    .get("[data-test='filtered-parks-container']").first().contains('The Memorial Building with fall colors: Over 200,000 people a year come to walk up the steps of the Memorial Building to visit the site where Abraham Lincoln was born. Address: 2995 Lincoln Farm Road Hodgenville, KY 42748')
    .get("[data-test='mainpage-image']").first().should('have.attr','src','https://www.nps.gov/common/uploads/structured_data/3C861078-1DD8-B71B-0B774A242EF6A706.jpg')
  })
 
  it('should be show a message letting user know that there are no parks based on the search input', () => {
    cy.get("[data-test='search-input']").type('Zebra').should('have.value', 'Zebra')
    cy.get("[data-test='search-button']").click()
    cy.get("[data-test='filterpage-backhome-button']").scrollIntoView();
    cy.get("[data-test='filterpage-backhome-button']").contains('button','Back To Homepage')
    cy.get("[data-test='no-parks-message']").contains('h2','Sorry, there are no sites by this name.')
  })
})

